INSERT INTO `publisher` VALUES (0,_binary '','nayanim','2023-02-22 10:48:00','Individual Publisher','Nayani Madhusanki','2023-02-22 10:48:30','16,Harmer\'s Avenue','null','0115245365',_binary '',NULL,NULL,'For go without Publisher'),(34,_binary '','nayanim','2023-03-30 00:00:00','අධ්‍යාපන ප්‍රකාශන දෙපාර්තමේන්තුව','Lakshitha Fernando','2023-05-26 00:00:00','අධ්‍යාපන ප්‍රකාශන දෙපාර්තමේන්තුව, ඉසුරුපාය, බත්තරමුල්ල, 10120','commissioner_epd@yahoo.com','0112 784815',_binary '','/publishers/profile-photos/pub-34.png','/publishers/cover-photos/pub-34.jpg','අධ්‍යාපන ප්‍රකාශන දෙපාර්තමේන්තුව, රටේ සමස්ථ ජනගහනයෙන් ආසන්න වශයෙන් 20% ක් නියෝජනය කරන පාසල් ප්‍රජාව සමඟ සෘජු සම්බන්ධයක් ඇතිව, සිසුන්ගේ මූලික අයිතිවාසිකම්වලින් එකක් වන අනිවාර්ය අධ්‍යාපනයේ අවශ්‍යතා සපුරාලීමට සහ ඔවුන්ට සමාන අවස්ථා ලබා දීමට සිය සේවාව ඉටු කරයි. අධ්යාපනය තුළ. සිසුන්ට පෙළපොත් ලබා දීම සහ ශිෂ්‍ය ජනගහනයට ගුරු උපදේශන අත්පොත් නියමිත වේලාවට සැපයීම සඳහා දෙපාර්තමේන්තුව සුවිශේෂී කාර්යභාරයක් ඉටු කරයි.\r\n\r\nගුණාත්මකව හොඳ පොතක් නියමිත වේලාවට සිසුන් අතට පත්කිරීම යන තේමාවට අනුව කටයුතු කරන අපට පසුගිය වසර කිහිපය තුළ අපේ අරමුණු ඉටුකර ගැනීමට හැකි වූ බව සඳහන් කළ යුතුයි.\r\n\r\nඅපගේ ඒකායන අභිප්‍රාය එළඹෙන සෑම දිනකම නව ජවයකින් සහ නැවුම් කෝපයකින් ඉදිරියට යාමයි. අපගේ මීළඟ ඉලක්කය වන්නේ සෑම විෂයයකටම අත්‍යවශ්‍ය සියලුම පෙළපොත් ඉලෙක්ට්‍රොනික ක්‍රමයෙන් සම්පාදනය කර මෙම වෙබ් අඩවියට උඩුගත කිරීමයි.\r\n\r\nඑම ඉලක්කය සපුරා ගැනීමට අවශ්‍ය පියවර අපි දැනටමත් ගෙන තිබෙනවා. සමහර පොත් දැනටමත් උඩුගත කර ඇති අතර ඔබට ඒවා බාගත කිරීමට හෝ ඒවා සමඟ අන්තර් ක්‍රියාකාරීව ඉගෙන ගැනීමට හැකි බව සඳහන් කිරීමට මම සතුටු වෙමි. අනෙකුත් සියලුම පෙළපොත් හැකි ඉක්මනින් අන්තර්ජාලයට උඩුගත කිරීම අපගේ අරමුණයි.'),(35,_binary '','ziora@gmail.com','2023-04-11 00:00:00','Ziora Education','nayanim','2023-04-11 00:00:00','12, Wellawaththa, Sri Lanka','ziora@gmail.com','0112365258',_binary '',NULL,NULL,'We are available for grade 10,11 models papers'),(36,_binary '\0','sumathipublishers@yahoo.com','2023-04-11 00:00:00','Sumathi Publishers','sumathipublishers@yahoo.com','2023-04-11 00: